window.bookSummaryJSON = "<p><b>This Complete Romantasy Collection Includes Midnight Fae Academy Books 1-4.<br> <br> </b><b><i>Welcome to Midnight Fae Academy.<br> Home of the Dark Arts.<br> Vampires.<br> And cruelly handsome fae.</i></b><br> <br> <b>A forbidden bite led to my capture and recruitment.</b><br> There are no flowers here.<br> No life.<br> Only death.<br> <br> I’m an Earth Fae who doesn’t belong here.<br> They can play their little mind games all they want, but I’m going to find a way back to my elemental world. Even if it kills me.<br> <br> Except Headmaster Zephyrus is one step ahead of my every move.<br> Prince Kolstov won’t stop cornering me.<br> And Shadow—the reason I’m in this damn mess to begin with—haunts my dreams.<br> <br> My affinity for the earth is dying and being replaced by something more sinister. Something powerful. Something deadly.<br> <br> The Midnight Fae believe this is my fate.<br> They claim that I was “recruited” for a purpose.<br> To battle a rising presence.<br> Or to die trying.<br> <br> I don’t owe them a damn thing. But if I have to pass their trials to find my way home, then so be it. I survived a plague and far worse in the Elemental Fae realm. An ominous energy? Please. What a joke.<br> <br> Give it your best shot.<br> I’m waiting.<br> And don’t you dare bite me.<br> Or I’ll make you regret it.<br> <br> <b>Author’s Note: </b>This is a <b>dark </b>paranormal why choose series with enemies-to-lovers elements. Despite Aflora’s opinions on the matter, there will definitely be biting. Shadow, a.k.a. Shade, guarantees it. The grovel begins in book two…<br> <br> <b>This is a complete series. No cliffhanger. And it features a happily ever after between Aflora and her four vampire-like mates.</b></p>"; 
